TagCell::TagCell(LPCSTR sValue,
		LPCSTR lborderstyle , LPCSTR rborderstyle , LPCSTR tborderstyle , LPCSTR bborderstyle ,
		float lborderpt , float rborderpt , float tborderpt , float bborderpt ,
		float tdwidth, float stwidth, float height,
		LPCSTR font, float fontsize, LPCSTR fontcolor, LPCSTR fontweight,
		int colspan, int rowspan,
		LPCSTR valign, LPCSTR halign
		)
{

	m_sValue = sValue;
	
	m_lborderstyle = lborderstyle;
	m_rborderstyle = rborderstyle;
	m_tborderstyle = tborderstyle;
	m_bborderstyle = bborderstyle;

	m_lborderpt = lborderpt;
	m_rborderpt = rborderpt;
	m_tborderpt = tborderpt;
	m_bborderpt = bborderpt;
	m_tdwidth = tdwidth;
	m_stwidth = stwidth;
	m_height = height;
	
	m_font = font;
	m_fontsize = fontsize;
	m_fontcolor = fontcolor;
	m_fontweight = fontweight;

	m_colspan = colspan;
	m_rowspan = rowspan;

	m_valign = valign;
	m_halign = halign;

}
