void TagCell::SetBorder(bound b, LPCSTR style, float pt)
{

	switch (b) {

	case LEFT:
		m_lborderstyle = style;
		m_lborderpt = pt;

		break;

	case RIGHT:
		m_rborderstyle = style;
		m_rborderpt = pt;

		break;

	case TOP:
		m_tborderstyle = style;
		m_tborderpt = pt;

		break;

	case BOTTOM:
		m_bborderstyle = style;
		m_bborderpt = pt;

		break;

	default:

		AfxMessageBox(_T("To be updated"));
		return;
		break;
	
	}


}

