CStatSimHTML::CStatSimHTML(CStatSimConn *pDB, LPCSTR sTable, CString sPath,
						   int cInd, int cE, LPCSTR sParentTable)
{
	
	m_pParentRS = NULL;
	m_pDB = pDB;
	m_pRS = new CStatSimRS( m_pDB );

	CStatSimRS rs( (m_pDB), (CString) "select min(int_yy) as int_yy0, max(int_yy) as int_yy1 from `hpq_hh` limit 1;" );

	if (_ttoi(rs.SQLFldValue(_MBCS("int_yy1"))) == _ttoi(rs.SQLFldValue(_MBCS("int_yy0"))) )
		m_sRef = rs.SQLFldValue(_MBCS("int_yy0"));
	else
		m_sRef = rs.SQLFldValue(_MBCS("int_yy0")) + _T(" - ") + rs.SQLFldValue(_MBCS("int_yy1"));

	CString sSQL;
	sSQL.Format(_T("SELECT * FROM `%s`"), (CString) sTable);
	error = m_pRS->RunSQL(sSQL);	//save error
	
	m_cInd = cInd;
	m_cE = cE;

	m_sTable = sTable;
	m_sParentTable = sParentTable;

	m_sPath = sPath;
	m_pFile = _tfopen(m_sPath, _T("w"));

	htmFD = _fileno(m_pFile);
	
	//Get data associated with htmFD:
	int FDres = fstat( htmFD, &FDbuff );

	if (cE>=COUNTRY) {
		m_pElt = new CStatSimElt(m_pDB, m_cE, TRUE);
		m_sLevel = m_pElt->ParAttr(element);
		m_pInd = new CStatSimInd(m_pDB, FIG, m_cInd, m_cE);
		m_IDFld = m_pElt->ParAttr(IDField);

		//numerator and denominator
		CString str;

		//test for death indicator
		if (m_cInd==IND_DEATH05 || m_cInd==IND_DEATHPREG) {
			IsDeath = TRUE;
		}
		else {
			IsDeath = FALSE;
		}

		str.Format( _T("%s_%s"), (CString) m_sLevel, m_pInd->sNumerator() );
		m_sNumerator = ConstChar(str);
		str.Format( _T("%s_%s"), (CString) m_sLevel, m_pInd->sDenominator() );
		m_sDenominator = ConstChar(str);

		//labels
		str.Format(_T("%s"), m_pInd->sNumeratorLabel());
		m_sNumeratorLabel = ConstChar(str);
		str.Format(_T("%s"), m_pInd->sDenominatorLabel());
		m_sDenominatorLabel = ConstChar(str);

		//indicator basic label and description/definition
		str.Format(_T("%s"), m_pInd->GetLabel());
		m_sLabel = ConstChar(str);
		str.Format(_T("%s"), m_pInd->GetDesc());
		m_sDesc = ConstChar(str);

		//sector
		str.Format(_T("%s"), m_pInd->GetSector());
		m_sSector = ConstChar(str);

		//computation		
		str.Format(_T("%s"), m_pInd->sPropCompute());
		m_sPropCompute = ConstChar(str);
		

	}

	if (sParentTable==NULL) {
		m_cParE = m_pElt->GetParent();
		m_pParElt = new CStatSimElt(m_pDB, m_cParE, TRUE);
		m_sParentTable = m_pParElt->ParAttr(element);
		m_sParLevel = m_pParElt->ParAttr(element);
		m_ParIDFld = m_pParElt->ParAttr(IDField);
		
		//numerator and denominator
		CString str;
		str.Format( _T("%s_%s"), (CString) m_sParLevel, m_pInd->sNumerator() );
		m_sParNumerator = ConstChar(str);
		str.Format( _T("%s_%s"), (CString) m_sParLevel, m_pInd->sDenominator() );
		m_sParDenominator = ConstChar(str);
	}
	else {
		m_pParElt = NULL;

	}

}

CStatSimHTML::CStatSimHTML(CStatSimConn *pDB, LPCSTR sTable, FILE *pFile,
						   int cInd, int cE, LPCSTR sParentTable)
{
	Construct(pDB, sTable, pFile, cInd, cE, sParentTable);
}

