CString CStatSimHTML::sSQLInit()
{

	CString sSQL;

	switch(m_cParE) {

	case MEM:
				
		sSQL = _T("");		

		break;

	case HH:
		
		sSQL = _T("");		

		break;

	case PUROK:
		
		sSQL.Format(_T("SELECT  `purok`.`purokID` AS `purokID`, `%s`.`Region` AS `Region`, `%s`.`Province` AS `Province`, `%s`.`Municipality` AS `Municipality`, `%s`.`Barangay` AS `Barangay`, `%s`.`PurokName` AS `PurokName`"), (CString) m_sTable, (CString) m_sTable, (CString) m_sTable, (CString) m_sTable, (CString) m_sTable);
		
		break;

	case BRGY:
		
		sSQL.Format(_T("SELECT  `brgy`.`brgyID` AS `brgyID`, `%s`.`Region` AS `Region`, `%s`.`Province` AS `Province`, `%s`.`Municipality` AS `Municipality`, `%s`.`Barangay` AS `Barangay`"), (CString) m_sTable, (CString) m_sTable, (CString) m_sTable, (CString) m_sTable);

		break;

	case MUN:
		
		sSQL.Format(_T("SELECT  `mun`.`munID` AS `munID`, `%s`.`Region` AS `Region`, `%s`.`Province` AS `Province`, `%s`.`Municipality` AS `Municipality`"), (CString) m_sTable, (CString) m_sTable, (CString) m_sTable);

		break;

	case PROV:
		
		sSQL.Format(_T("SELECT  `prov`.`provID` AS `provID`, `%s`.`Region` AS `Region`, `%s`.`Province` AS `Province`"), (CString) m_sTable, (CString) m_sTable);

		break;

	case REGN:
		
		sSQL.Format(_T("SELECT  `regn`.`regnID` AS `regnID`, `%s`.`Region` AS `Region`"), (CString) m_sTable);

		break;
		
	default:

		AfxMessageBox(_T("To be updated!"));
		break;
	
	}

	return sSQL;

}

