CString CStatSimHTML::sSQLFrom()
{

	CString sSQL;
	

	switch(m_cParE) {

	case MEM:
				
		sSQL = _T("");		

		break;

	case HH:
		
		sSQL = _T("");		

		break;

	case PUROK:
		
		sSQL.Format(_T("FROM `purok` INNER JOIN `%s` ON (LEFT(`purok`.`purokID`, 11) = LEFT(`%s`.`purokID`, 11))"), (CString) m_sTable, (CString) m_sTable);
		
		break;

	case BRGY:
		
		sSQL.Format(_T("FROM `brgy` INNER JOIN `%s` ON (LEFT(`brgy`.`brgyID`, 9) = LEFT(`%s`.`brgyID`, 9))"), (CString) m_sTable, (CString) m_sTable);
	
		break;

	case MUN:
		
		sSQL.Format(_T("FROM `mun` INNER JOIN `%s` ON (LEFT(`mun`.`munID`, 6) = LEFT(`%s`.`munID`, 6))"), (CString) m_sTable, (CString) m_sTable);

		break;

	case PROV:
		
		sSQL.Format(_T("FROM `prov` INNER JOIN `%s` ON (LEFT(`prov`.`provID`, 4) = LEFT(`%s`.`provID`, 4))"), (CString) m_sTable, (CString) m_sTable);

		break;

	case REGN:
		
		sSQL.Format(_T("FROM `regn` INNER JOIN `%s` ON (LEFT(`regn`.`regnID`, 2) = LEFT(`%s`.`regnID`, 2))"), (CString) m_sTable, (CString) m_sTable);
		
		break;
		
	default:

		AfxMessageBox(_T("To be updated!"));
		break;
	
	}

	return sSQL;

}

