void CStatSimHTML::DrawCell(TagCell cell)
{


	CString sTag, sColSpan, sRowSpan, sVAlign;

	if ( cell.GetColSpan()>1 ) {
		sColSpan.Format( _T("colspan=%d"), cell.GetColSpan() );
	}
	else {
		sColSpan = _MBCS("");
	}

	if ( cell.GetRowSpan()>1 ) {
		sRowSpan.Format( _T("rowspan=%d"), cell.GetRowSpan() );
	}
	else {
		sRowSpan = _MBCS("");
	}

	if ( cell.GetVAlign()!=NULL ) {
		sVAlign.Format(_T("valign=%s"), cell.GetVAlign() );
	}
	else {
		sVAlign = _MBCS("");
	}


	sTag.Format(_T("<td width=%.0f %s %s %s style='width:%.1fpt;border-top:%s %.2fpt;\n"), 
		cell.GetTDWidth(), sColSpan, sRowSpan, sVAlign, cell.GetSTWidth(), cell.GetBorderStyle(TOP), cell.GetBorderSize(TOP) );
	_ftprintf(m_pFile, sTag);	   

	sTag.Format(_T("border-left:%s %.2fpt;border-bottom:%s %.2fpt;border-right:%s %.1fpt;\n"), 
		cell.GetBorderStyle(LEFT), cell.GetBorderSize(LEFT), cell.GetBorderStyle(BOTTOM), cell.GetBorderSize(BOTTOM), 
		cell.GetBorderStyle(RIGHT), cell.GetBorderSize(RIGHT) );
	_ftprintf(m_pFile, sTag);	   
	
	sTag.Format(_T("padding:0in 5.4pt 0in 5.4pt;height:%.2fpt'>\n"), 
		cell.GetHeight() );
	_ftprintf(m_pFile, sTag);	   

	//alignment - to be modified
	_ftprintf(m_pFile, _T("<p class=MsoNormal align=right style='text-align:right'>\n"));	

	sTag.Format(_T("<%s><span style='font-size:%.1fpt;font-family:%s;color:%s'>%s<o:p></o:p></span></%s></p>\n"), 
		cell.GetFontWeight(), cell.GetFontSize(), cell.GetFont(), cell.GetFontColor(), cell.GetValue(), cell.GetFontWeight() );
	_ftprintf(m_pFile, sTag);	   

	_ftprintf(m_pFile, _T("</td>\n"));

}

