		//sql
		sSQL.Format(_T("SELECT COUNT(`hpq_mem`.`hcn`) AS `count`, AVG(`hh_ind`.`hh_pci`) AS `pci`, SUM(`nunempl15ab`) AS `unempl15ab`, SUM(`nlabfor`) AS `labfor`, \n\
			SUM(`nmem05`) AS `mem05`, SUM(`ndeath05`) AS `death05`, SUM(`nmaln05`) AS `maln05`, SUM(`nmem01`) AS `mem01`, SUM(`ndeathpreg`) AS `deathpreg` \n\
			FROM `hpq_mem` INNER JOIN (`hh_ind` INNER JOIN `hh_coreind` ON `hh_ind`.`hhID` = `hh_coreind`.`hhID`) ON (`hpq_mem`.`hcn` = `hh_ind`.`hcn`) AND (`hpq_mem`.`purok` = `hh_ind`.`purok`) AND (`hpq_mem`.`brgy` = `hh_ind`.`brgy`) AND (`hpq_mem`.`mun` = `hh_ind`.`mun`) AND (`hpq_mem`.`prov` = `hh_ind`.`prov`)\n\
			WHERE ( (`hpq_mem`.`reln`=1) AND LEFT(`hh_coreind`.`hhID`, %s)=LEFT('%s', %s) );"), 
			(CString) m_pParElt->Attr(digit), sLevelID, (CString) m_pParElt->Attr(digit) );

		pDrawRS = new CStatSimRS( m_pDB, sSQL );
		
		//tot ref per
		if (pDrawRS->GetRecordCount()>0) {
			pDrawRS->MoveFirst();
			denomTot = _ttoi( pDrawRS->SQLFldValue(_MBCS("count") ) );
		}
		
		sTagVal.Format(_T("%d"), denomTot);
		
