		pCell->SetFont(_MBCS("Arial"), 10.0, _MBCS("black"), _MBCS("b"));
		DrawCell(*pCell);
		////////////////////////////////////////

		//proportion
		if (denomTot!=0) {
			floatval = (denomTot/denomTot)*100;
			sTagVal.Format(_T("%.1f"), floatval);
		}
		else {
			sTagVal = _MBCS("-");
		}

		////////////////////////////////////////
		pCell->SetValue( ConstChar(sTagVal) );
