		pCell->SetFont(_MBCS("Arial"), 10.0, _MBCS("black"), _MBCS("b"));
		DrawCell(*pCell);
		////////////////////////////////////////

		//proportion of unem
		if (pDrawRS->GetRecordCount()>0) {
			pDrawRS->MoveFirst();
			intval = _ttoi( pDrawRS->SQLFldValue(_MBCS("unempl15ab") ) );
			intval2 = _ttoi( pDrawRS->SQLFldValue(_MBCS("labfor") ) );
		}
		
		if ( intval2!=0 ) {
			floatval = ( (float) intval / (float) intval2 )*100;
			sTagVal.Format(_T("%.1f"), floatval);
		}
		else {
			sTagVal = _MBCS("-");
		}

		////////////////////////////////////////
		pCell->SetValue( ConstChar(sTagVal) );
		pCell->SetBorder(TOP, _MBCS("double windowtext"), 2.25);
		pCell->SetBorder(BOTTOM, _MBCS("double windowtext"), 2.25);
