void CStatSimHTML::IterCDP21(CString srcTab, int ID, CStatSimRS *pRS, CString sCrit, 
	CString sTitle, CString sAddlLab)
{
	CString sSQL, sAddWhere, sGeo;

	pRS->MoveFirst();
	if (pRS->GetRecordCount()<=0) {
		AfxMessageBox(_T("Empty records."));
		return;
	}

	if (sAddlLab!=_T("")) {
		sAddlLab = _T(", ") + sAddlLab;
	}

	if (sCrit==_T("")) {
		sAddWhere = _T("");
	}
	else {
		sAddWhere = _T("AND ") + sCrit;
	}

	for (int i=0; i<pRS->GetRecordCount(); i++) {
		

		switch(ID) {			
					
		case IND_CDP21_PUROK:			
					
			if (m_qnrID!=1020130100 && m_qnrID!=1020130101 && m_qnrID!=1020135100 && m_qnrID!=1020135200 && m_qnrID!=1020135300 && m_qnrID!=1020135400 && m_qnrID!=1020135500) {
			sSQL.Format(_T("SELECT `sex`, `age_yr`, `relgn`, `civstat` FROM `%s` WHERE `purok`='%s' AND `brgy`='%s' AND `mun`='%s' AND `prov`='%s' AND `regn`='%s' %s;"), 
				srcTab, pRS->SQLFldValue(_MBCS("purok")), pRS->SQLFldValue(_MBCS("brgy")), pRS->SQLFldValue(_MBCS("mun")), pRS->SQLFldValue(_MBCS("prov")), pRS->SQLFldValue(_MBCS("regn")),
				sAddWhere);
			}
			else {
			sSQL.Format(_T("SELECT `sex`, `age_yr`, `civstat` FROM `%s` WHERE `purok`='%s' AND `brgy`='%s' AND `mun`='%s' AND `prov`='%s' AND `regn`='%s' %s;"), 
				srcTab, pRS->SQLFldValue(_MBCS("purok")), pRS->SQLFldValue(_MBCS("brgy")), pRS->SQLFldValue(_MBCS("mun")), pRS->SQLFldValue(_MBCS("prov")), pRS->SQLFldValue(_MBCS("regn")),
				sAddWhere);
			}
			sGeo = pRS->SQLFldValue(_MBCS("PurokName")) + _T(", ") + pRS->SQLFldValue(_MBCS("Barangay")) + _T(", ")
				+ pRS->SQLFldValue(_MBCS("Municipality")) + _T(", ") + pRS->SQLFldValue(_MBCS("Province"));
					
			break;		
					
		case IND_CDP21_BRGY:			
					
			if (m_qnrID!=1020130100 && m_qnrID!=1020130101 && m_qnrID!=1020135100 && m_qnrID!=1020135200 && m_qnrID!=1020135300 && m_qnrID!=1020135400 && m_qnrID!=1020135500) {
			sSQL.Format(_T("SELECT `sex`, `age_yr`, `relgn`, `civstat` FROM `%s` WHERE `brgy`='%s' AND `mun`='%s' AND `prov`='%s' AND `regn`='%s' %s;"), 
				srcTab, pRS->SQLFldValue(_MBCS("brgy")), pRS->SQLFldValue(_MBCS("mun")), pRS->SQLFldValue(_MBCS("prov")), pRS->SQLFldValue(_MBCS("regn")),
				sAddWhere);
			}
			else {
			sSQL.Format(_T("SELECT `sex`, `age_yr`, `civstat` FROM `%s` WHERE `brgy`='%s' AND `mun`='%s' AND `prov`='%s' AND `regn`='%s' %s;"), 
				srcTab, pRS->SQLFldValue(_MBCS("brgy")), pRS->SQLFldValue(_MBCS("mun")), pRS->SQLFldValue(_MBCS("prov")), pRS->SQLFldValue(_MBCS("regn")),
				sAddWhere);
			}

			sGeo = pRS->SQLFldValue(_MBCS("Barangay")) + _T(", ")
				+ pRS->SQLFldValue(_MBCS("Municipality")) + _T(", ") + pRS->SQLFldValue(_MBCS("Province"));
					
			break;		
					
		case IND_CDP21_MUN:			
					
			if (m_qnrID!=1020130100 && m_qnrID!=1020130101 && m_qnrID!=1020135100 && m_qnrID!=1020135200 && m_qnrID!=1020135300 && m_qnrID!=1020135400 && m_qnrID!=1020135500) {
			sSQL.Format(_T("SELECT `sex`, `age_yr`, `relgn`, `civstat` FROM `%s` WHERE `mun`='%s' AND `prov`='%s' AND `regn`='%s' %s;"), 
				srcTab, pRS->SQLFldValue(_MBCS("mun")), pRS->SQLFldValue(_MBCS("prov")), pRS->SQLFldValue(_MBCS("regn")),
				sAddWhere);
			}
			else {
			sSQL.Format(_T("SELECT `sex`, `age_yr`, `civstat` FROM `%s` WHERE `mun`='%s' AND `prov`='%s' AND `regn`='%s' %s;"), 
				srcTab, pRS->SQLFldValue(_MBCS("mun")), pRS->SQLFldValue(_MBCS("prov")), pRS->SQLFldValue(_MBCS("regn")),
				sAddWhere);
			}

			sGeo = pRS->SQLFldValue(_MBCS("Municipality")) + _T(", ") + pRS->SQLFldValue(_MBCS("Province"));

			break;		
					
		case IND_CDP21_PROV:			
					
			if (m_qnrID!=1020130100 && m_qnrID!=1020130101 && m_qnrID!=1020135100 && m_qnrID!=1020135200 && m_qnrID!=1020135300 && m_qnrID!=1020135400 && m_qnrID!=1020135500) {
			sSQL.Format(_T("SELECT `sex`, `age_yr`, `relgn`, `civstat` FROM `%s` WHERE `prov`='%s' AND `regn`='%s' %s;"), 
				srcTab, pRS->SQLFldValue(_MBCS("prov")), pRS->SQLFldValue(_MBCS("regn")),
				sAddWhere);
			}
			else {
			sSQL.Format(_T("SELECT `sex`, `age_yr`, `civstat` FROM `%s` WHERE `prov`='%s' AND `regn`='%s' %s;"), 
				srcTab, pRS->SQLFldValue(_MBCS("prov")), pRS->SQLFldValue(_MBCS("regn")),
				sAddWhere);
			}
					
			sGeo = pRS->SQLFldValue(_MBCS("Province")) + _T(", ") + pRS->SQLFldValue(_MBCS("Region"));

			break;		
					
		case IND_CDP21_REGN:			
					
			if (m_qnrID!=1020130100 && m_qnrID!=1020130101 && m_qnrID!=1020135100 && m_qnrID!=1020135200 && m_qnrID!=1020135300 && m_qnrID!=1020135400 && m_qnrID!=1020135500) {
			sSQL.Format(_T("SELECT `sex`, `age_yr`, `relgn`, `civstat` FROM `%s` WHERE `regn`='%s' %s;"), 
				srcTab, pRS->SQLFldValue(_MBCS("regn")),
				sAddWhere);
			}
			else {
			sSQL.Format(_T("SELECT `sex`, `age_yr`, `civstat` FROM `%s` WHERE `regn`='%s' %s;"), 
				srcTab, pRS->SQLFldValue(_MBCS("regn")),
				sAddWhere);
			}
					
			sGeo = pRS->SQLFldValue(_MBCS("Region"));

			break;		
					
		default:			
					
			AfxMessageBox(_T("To be updated!"));		
			break;		
					
		}			
		
		m_pRS = new CStatSimRS(m_pDB, sSQL);

		if (m_pRS->GetRecordCount()<=0)
			continue;
		
		//civil status by sex
		DrawXTab(TRUE, sTitle, _T("Sex by Civil Status: ") + sGeo + sAddlLab, _MBCS("civstat"), _MBCS("sex"));
	
		//religion by sex
		if (m_qnrID!=1020130100 && m_qnrID!=1020130101 && m_qnrID!=1020135100 && m_qnrID!=1020135200 && m_qnrID!=1020135300 && m_qnrID!=1020135400 && m_qnrID!=1020135500) {
			DrawXTab(TRUE, sTitle, _T("Religion by Sex: ") + sGeo + sAddlLab, _MBCS("relgn"), _MBCS("sex"));
		}
		//age distribution by sex
		DrawFDxT(TRUE, sTitle, _T("Members 10 years old and above, Sex by Age Group: ") + sGeo + sAddlLab, _MBCS("age_yr"), _MBCS("sex"),
				5, 10, 80 );		

		//age distribution by civil status
		DrawFDxT(TRUE, sTitle, _T("Civil Status by Age Group: ") + sGeo + sAddlLab, _MBCS("age_yr"), _MBCS("civstat"),
				5, 0, 80 );	
		
		//age distribution by civil status
		DrawFDxT(TRUE, sTitle, _T("Members 10 years old and above, Civil Status by Age Group: ") + sGeo + sAddlLab, _MBCS("age_yr"), _MBCS("civstat"),
				5, 10, 80 );	

		delete m_pRS; m_pRS = 0;

		pRS->MoveNext();
	}


}
void CStatSimHTML::IterFDxT(CString srcTab, int ID, CStatSimRS *pRS, CString sCrit, CString sAddlLab,
		BOOL wLabels, CString sTitle, CString sSubTitle,
		LPCSTR sRow, LPCSTR sCol, int cl_size, int min, int upper, CString sZeroLab)
{
	CString sSQL, sAddWhere, sGeo;

	pRS->MoveFirst();
	if (pRS->GetRecordCount()<=0) {
		AfxMessageBox(_T("Empty records."));
		return;
	}

	if (sCrit==_T("")) {
		sAddWhere = _T("");
	}
	else {
		sAddWhere = _T("AND ") + sCrit;
	}

	for (int i=0; i<pRS->GetRecordCount(); i++) {
		
		GetStrings(ID, pRS, sSQL, sGeo, srcTab, (CString) sRow, (CString) sCol, sAddWhere);
		
		m_pRS = new CStatSimRS(m_pDB, sSQL);

		if (error==SQL_ERROR)
			continue;

		if (m_pRS->GetRecordCount()<=0)
			continue;
		
		//age distribution by sex
		DrawFDxT(TRUE, sTitle, sAddlLab + _T(", ") + sGeo, sRow, sCol,
				cl_size, min, upper, sZeroLab );		

		delete m_pRS; m_pRS = 0;

		pRS->MoveNext();
	}


}

int CStatSimHTML::GetStrings(int ID, CStatSimRS* pRS, CString& sSQL, CString& sGeo, CString srcTab, CString sRow, CString sCol, CString sAddWhere)
{
		
	if (ID==IND_CDP21_PUROK || ID==IND_CDP22_PUROK		
		|| ID==IND_CDP23_PUROK || ID==IND_CDP24_PUROK) {	
			
		sSQL.Format(_T("SELECT `%s`, `%s` FROM `%s` WHERE `purok`='%s' AND `brgy`='%s' AND `mun`='%s' AND `prov`='%s' AND `regn`='%s' %s;"), sRow, sCol,	
			srcTab, pRS->SQLFldValue(_MBCS("purok")), pRS->SQLFldValue(_MBCS("brgy")), pRS->SQLFldValue(_MBCS("mun")), pRS->SQLFldValue(_MBCS("prov")), pRS->SQLFldValue(_MBCS("regn")),
			sAddWhere);
			
		sGeo = pRS->SQLFldValue(_MBCS("PurokName")) + _T(", ") + pRS->SQLFldValue(_MBCS("Barangay")) + _T(", ")	
			+ pRS->SQLFldValue(_MBCS("Municipality")) + _T(", ") + pRS->SQLFldValue(_MBCS("Province"));
			
	}		
	else if (ID==IND_CDP21_BRGY || ID==IND_CDP22_BRGY		
		|| ID==IND_CDP23_BRGY || ID==IND_CDP24_BRGY) {	
			
		sSQL.Format(_T("SELECT `%s`, `%s` FROM `%s` WHERE `brgy`='%s' AND `mun`='%s' AND `prov`='%s' AND `regn`='%s' %s;"), sRow, sCol, 	
			srcTab, pRS->SQLFldValue(_MBCS("brgy")), pRS->SQLFldValue(_MBCS("mun")), pRS->SQLFldValue(_MBCS("prov")), pRS->SQLFldValue(_MBCS("regn")),
			sAddWhere);
			
		sGeo = pRS->SQLFldValue(_MBCS("Barangay")) + _T(", ")	
			+ pRS->SQLFldValue(_MBCS("Municipality")) + _T(", ") + pRS->SQLFldValue(_MBCS("Province"));
			
	}		
	else if (ID==IND_CDP21_MUN || ID==IND_CDP22_MUN		
		|| ID==IND_CDP23_MUN || ID==IND_CDP24_MUN) {	
			
		sSQL.Format(_T("SELECT `%s`, `%s` FROM `%s` WHERE `mun`='%s' AND `prov`='%s' AND `regn`='%s' %s;"), sRow, sCol, 	
			srcTab, pRS->SQLFldValue(_MBCS("mun")), pRS->SQLFldValue(_MBCS("prov")), pRS->SQLFldValue(_MBCS("regn")),
			sAddWhere);
			
		sGeo = pRS->SQLFldValue(_MBCS("Municipality")) + _T(", ") + pRS->SQLFldValue(_MBCS("Province"));	
			
	}		
	else if (ID==IND_CDP21_PROV || ID==IND_CDP22_PROV		
		|| ID==IND_CDP23_PROV || ID==IND_CDP24_PROV) {	
			
		sSQL.Format(_T("SELECT `%s`, `%s` FROM `%s` WHERE `prov`='%s' AND `regn`='%s' %s;"), sRow, sCol, 	
			srcTab, pRS->SQLFldValue(_MBCS("prov")), pRS->SQLFldValue(_MBCS("regn")),
			sAddWhere);
			
		sGeo = pRS->SQLFldValue(_MBCS("Province")) + _T(", ") + pRS->SQLFldValue(_MBCS("Region"));	
			
	}		
	else if (ID==IND_CDP21_REGN || ID==IND_CDP22_REGN		
		|| ID==IND_CDP23_REGN || ID==IND_CDP24_REGN) {	
			
		sSQL.Format(_T("SELECT `%s`, `%s` FROM `%s` WHERE `regn`='%s' %s;"), sRow, sCol, 	
			srcTab, pRS->SQLFldValue(_MBCS("regn")),
			sAddWhere);
			
		sGeo = pRS->SQLFldValue(_MBCS("Region"));	
	}		
	else {		
			
		AfxMessageBox(_T("To be updated!"));	
		sSQL = _T("");	
		return -1;	
	}		
			
	return 1;		
								
}

void CStatSimHTML::IterXTab(CString srcTab, int ID, CStatSimRS *pRS, CString sCrit, CString sAddlLab,
		BOOL wLabels, CString sTitle, CString sSubTitle,
		LPCSTR sRow, LPCSTR sCol, CString sZeroLab, int numidx, int denomidx)
{
	CString sSQL, sAddWhere, sGeo;

	pRS->MoveFirst();
	if (pRS->GetRecordCount()<=0) {
		AfxMessageBox(_T("Empty records."));
		return;
	}

	if (sCrit==_T("")) {
		sAddWhere = _T("");
	}
	else {
		sAddWhere = _T("AND ") + sCrit;
	}

		
	for (int i=0; i<pRS->GetRecordCount(); i++) {
		
		GetStrings(ID, pRS, sSQL, sGeo, srcTab, (CString) sRow, (CString) sCol, sAddWhere);

		//AfxMessageBox(sSQL);

		m_pRS = new CStatSimRS(m_pDB, sSQL);

		if (error==SQL_ERROR || m_pRS->GetRecordCount()<=0) {
			//AfxMessageBox(sSQL);
			pRS->MoveNext();
			continue;
		}
		
		//AfxMessageBox(sSQL);
		//template crosstab
		DrawXTab(wLabels, sTitle, sAddlLab + _T(", ") + sGeo, sRow, sCol, sZeroLab, numidx, denomidx);
	
		pRS->MoveNext();
		delete m_pRS; m_pRS = 0;

	}


}
void CStatSimHTML::DrawXTab(BOOL wLabels, CString sTitle, CString sSubTitle, LPCSTR sRow, 
	LPCSTR sCol, CString sZeroLab, int numidx, int denomidx, CString sLabelTable) 
{

	CString sTagVal, sMarginalLab;
	BOOL wColLabels = wLabels, wRowLabels = wLabels;
	std::map<int, CString> colLabels, rowLabels;

	if (numidx>=0 && denomidx>=0) {
		sMarginalLab = _T("Ratio");
	}
	else {
		sMarginalLab = _T("Total");
	}
	if (wLabels) {
		wColLabels = GetLabels(colLabels, (CString) sCol, sZeroLab, sLabelTable);
		wRowLabels = GetLabels(rowLabels, (CString) sRow, sZeroLab, sLabelTable);
	}

	if (error==SQL_ERROR) {
		return;
	}

	std::vector<std::vector<string>> rs_array;

	if (m_pRS->GetRecordCount()>0) {
		m_pRS->MoveFirst();
	}

	for (int i=0; i<m_pRS->GetRecordCount(); i++) {
		std::vector<string> temp_row;
		temp_row.push_back(ConstChar(m_pRS->SQLFldValue(sRow)));
		temp_row.push_back(ConstChar(m_pRS->SQLFldValue(sCol)));
		rs_array.push_back(temp_row);
		m_pRS->MoveNext();
	}
	
	daextab html_xtab(rs_array, 0, 1);
	//daefdxt html_xtab(rs_array, 0, 1, cl_size, min, upper);

	//initial printing
	_ftprintf(m_pFile, _T("<HTML><HEAD>\n"));
	_ftprintf(m_pFile, _T("<TITLE>CBMS StatSim Pro 6.0</TITLE>\n"));
	_ftprintf(m_pFile, _T("</HEAD>\n"));
	_ftprintf(m_pFile, _T("<BODY>\n"));
	_ftprintf(m_pFile, _T("<hr /><hr />"));
	_ftprintf(m_pFile, _T("<img border='0' src='.\\images\\logo.jpg' align='left' width='86' height='110'>\n"));
	_ftprintf(m_pFile, _T("<P><BR><b><span style='font-size:16.0pt;font-family:Arial;color:maroon'>CBMS StatSim Pro 6.0</span></b>\n"));
	
	_ftprintf(m_pFile, _T("<BR><b>") + sTitle + _T("</b><BR>\n"));
	_ftprintf(m_pFile, _T("<i>") + sSubTitle + _T("</i><P>\n"));
	//_ftprintf(m_pFile, _T("<TABLE width=250 border=1 cellspacing=1 cellpadding=3>\n"));
	_ftprintf(m_pFile, _T("<TABLE border=1 cellspacing=1 cellpadding=3>\n"));

	if (!m_pRS) {
		_ftprintf(m_pFile, _T("</TABLE></BODY></HTML>\n"));
		return;
	}
	
	try
	{

/*		intvec2d::iterator it1;
		FILE *pFile = fopen("d:\\xtab.log", "w");
		for (it1=html_xtab.value_array.begin(); it1<html_xtab.value_array.end(); ++it1) {
			intvec1d::iterator it2;
			for (it2=it1->begin(); it2<it1->end(); ++it2) {
				sTagVal.Format(_T("%d"), *it2);
				_ftprintf( pFile, ConstChar(sTagVal) );
				_ftprintf(pFile, _T("\t"));
			}
			_ftprintf(pFile, _T("\n"));
		}
			
		fclose(pFile);
*/

		//CString msg;
		//msg.Format(_T("Size: %d x %d"), html_xtab.n_x(), html_xtab.n_y());
		//AfxMessageBox(msg);
		//field names
		for (int j=0; j<html_xtab.n_y()+1; j++) {
			CString sPrint, s_ncols;
			s_ncols.Format(_T("%d"), html_xtab.n_y());

			if (j==0) {
				//sTagVal.Format(_T("%s - %s"), sRow, sCol);
				//sTagVal.Format(_T("%s"), sRow);
				CString s_row(sRow), s_col(sCol);
				//sPrint = _T("<TR><TD width=25 rowspan=2><b>") + s_row + _T("</b></TD>\n") +
				sPrint = _T("<TR><TD align=center rowspan=2><b>") + s_row + _T("</b></TD>\n") +
					_T("<TD align=center colspan=") + s_ncols + _T("><b>") + s_col + _T("</b></TD> <TD align=center rowspan=2><b>") + sMarginalLab + _T("</b></TD> </TR> \n");
			}
			else {
				if (wColLabels) {
					CString cVal(html_xtab.scol(j-1).c_str());
					if (cVal.MakeLower()==_T("null")) {
						sTagVal = _T("Missing");
					}
					else {
						CString sLab(colLabels[atoi(html_xtab.scol(j-1).c_str())]);
						if (sLab.IsEmpty()) {
							sTagVal.Format(_T("%s"), (CString) html_xtab.scol(j-1).c_str());
						}
						else {
							sTagVal.Format(_T("%s"), sLab);
						}
					}
				}
				else {
					CString cVal(html_xtab.scol(j-1).c_str());
					if (cVal.MakeLower()==_T("null")) {
						sTagVal = _T("Missing");
					}
					else {
						sTagVal = cVal;
					}
				}
				sPrint = _T("<TH align=right>") + sTagVal + _T("</TH>\n");
			}
			
			_ftprintf( m_pFile, (sPrint) );	
		}
		
		for (int i=0; i<html_xtab.n_x(); i++) {

			if (!(i%2))
				_ftprintf(m_pFile, _T("<tr style='mso-yfti-irow:5'>\n"));
			else
				_ftprintf(m_pFile, _T("<TR>\n"));
		
			for (int j=0; j<html_xtab.n_y()+2; j++) {

				if (j==0) {
					if (wRowLabels) {			
						CString cVal(html_xtab.srow(i).c_str());
						if (cVal.MakeLower()==_T("null")) {		
							sTagVal = _T("Missing");	
						}		
						else {		
							CString sLab(rowLabels[atoi(html_xtab.srow(i).c_str())]);	
							if (sLab.IsEmpty()) {	
								sTagVal.Format(_T("%s"), (CString) html_xtab.srow(i).c_str());
							}	
							else {	
								sTagVal.Format(_T("%s"), sLab);
							}	
						}		
					}			
					else {			
						CString cVal(html_xtab.srow(i).c_str());
						if (cVal.MakeLower()==_T("null")) {		
							sTagVal = _T("Missing");	
						}	
						else {
							sTagVal = cVal;
						}
					}			
				}
				//AfxMessageBox(sTagVal);
				else if (j==html_xtab.n_y()+1) {
					if (numidx>=0 && denomidx>=0) {
						float fVal = html_xtab.row_ratio(i, numidx, denomidx);
						if (fVal==OVERFLOW)
							sTagVal = _MBCS(" - ");
						else
							sTagVal.Format(_T("%.2f"), fVal );
					}
					else {
						sTagVal.Format(_T("%d"), html_xtab.row_tot(i));
					}
				}
				else {
					sTagVal.Format(_T("%d"), html_xtab.at(i, j-1));
				}
							
				if (!(i%2)) {
					if (j==0) {
						_ftprintf(m_pFile, _T("<td style='background:#E0E0E0;padding:2.25pt 2.25pt 2.25pt 2.25pt'>\n"));
						_ftprintf(m_pFile, _T("<p class=MsoNormal align=right style='text-align:right'><b>") + sTagVal + _T("<o:p></o:p></b></p>\n"));
						_ftprintf(m_pFile, _T("</td>\n"));

					}
					else {
						_ftprintf(m_pFile, _T("<td nowrap style='background:#E0E0E0;padding:2.25pt 2.25pt 2.25pt 2.25pt'>\n"));
						_ftprintf(m_pFile, _T("<p class=MsoNormal align=right style='text-align:right'>") + sTagVal + _T("</p>\n"));
						_ftprintf(m_pFile, _T("</td>\n"));
					}
				}
				else {
					if (j==0) {
						_ftprintf(m_pFile, _T("<TH align=right>") + sTagVal + _T("</TH>\n"));
					}
					else {
						_ftprintf(m_pFile, _T("<TD nowrap align=right>") + sTagVal + _T("</TD>\n"));
					}
				}

				//AfxMessageBox(sTagVal);
				
			}	
			_ftprintf(m_pFile, _T("</TR>\n"));		
		}
		for (int j=0; j<html_xtab.n_y()+2; j++) {
			if (j==0) {
				if (numidx>=0 && denomidx>=0) {
					sTagVal = _MBCS("Ratio");
				}
				else {
					sTagVal = _MBCS("Total");
				}
			}
			else if (j==html_xtab.n_y()+1) {
				if (numidx>=0 && denomidx>=0) {
					sTagVal.Format(_T("%.2f"), (float)html_xtab.row_tot(numidx) / (float)html_xtab.row_tot(denomidx) );
				}
				else {
					sTagVal.Format(_T("%d"), html_xtab.gr_tot());
				}

			}
			else {
				if (numidx>=0 && denomidx>=0) {
					float fVal = html_xtab.col_ratio(j-1, numidx, denomidx);
					if (fVal==OVERFLOW)
						sTagVal = _MBCS(" - ");
					else
						sTagVal.Format(_T("%.2f"), fVal );
				}
				else {
					sTagVal.Format(_T("%d"), html_xtab.col_tot(j-1));
				}
			}
							
			if (!(html_xtab.n_x()%2)) {
				if (j==0) {
					_ftprintf(m_pFile, _T("<td style='background:#E0E0E0;padding:2.25pt 2.25pt 2.25pt 2.25pt'>\n"));
					_ftprintf(m_pFile, _T("<p class=MsoNormal align=center style='text-align:right'><b>") + sTagVal + _T("<o:p></o:p></b></p>\n"));
					_ftprintf(m_pFile, _T("</td>\n"));

				}
				else {
					_ftprintf(m_pFile, _T("<td nowrap style='background:#E0E0E0;padding:2.25pt 2.25pt 2.25pt 2.25pt'>\n"));
					_ftprintf(m_pFile, _T("<p class=MsoNormal align=right style='text-align:right'>") + sTagVal + _T("</p>\n"));
					_ftprintf(m_pFile, _T("</td>\n"));
				}
			}
			else {
				if (j==0) {
					_ftprintf(m_pFile, _T("<TH align=right>") + sTagVal + _T("</TH>\n"));
				}
				else {
					_ftprintf(m_pFile, _T("<TD nowrap align=right>") + sTagVal + _T("</TD>\n"));
				}
			}

		
		}

		_ftprintf(m_pFile, _T("</TR>\n"));		
	
		_ftprintf(m_pFile, _T("</TABLE></BODY></HTML>\n"));
	}
	
	catch(_com_error &e) 
	{		
		_bstr_t bstrSource (e.Source());
		_bstr_t bstrDescription (e.Description());
		TRACE ( "Exception thrown for classes generated by #import" );
		TRACE ( "\tCode = %08lx\n", e.Error ());
		TRACE ( "\tCode meaning = %s\n", e.ErrorMessage ());
		TRACE ( "\tSource = %s\n", (LPCSTR) bstrSource);
		TRACE ( "\tDescription = %s\n", (LPCSTR) bstrDescription);

		AfxMessageBox ((LPCTSTR) bstrDescription);
	}

}

BOOL CStatSimHTML::GetLabels(std::map<int, CString> &colLabels, CString var, CString sLabForZero,
	CString sFromTable)
{
	CString sSQL;
	std::map<CString, CString> sLabelsFld;
	sLabelsFld[_T("purok")]=_T("PurokName");
	sLabelsFld[_T("brgy")]=_T("Barangay");
	sLabelsFld[_T("mun")]=_T("Municipality");
	sLabelsFld[_T("prov")]=_T("Province");
	sLabelsFld[_T("regn")]=_T("Region");

	if (sFromTable == _T("~helementvalue") || sFromTable == _T("~valuelabels") )
		sSQL.Format(_T("SELECT * FROM `%s` WHERE `var`='%s' ORDER BY `value`;"), sFromTable, var);
	else {
		sSQL.Format(_T("SELECT * FROM `%s` ORDER BY `%s`;"), sFromTable, sFromTable);
	}

	CStatSimRS *pRS = new CStatSimRS(m_pDB, sSQL);
	
	if (pRS->GetRecordCount()<=0){
		//don't need to send message
		//CString msg; msg.Format(_T("No labels for '%s'."), var);
		//AfxMessageBox(msg);
		return FALSE;
	}
	else {
		//if (sLabForZero==_T("NULL"))// parang mali ang mapping
		colLabels[0] = sLabForZero;
		for (int i=0; i<pRS->GetRecordCount(); i++) {

			int val;

			if (sFromTable == _T("~helementvalue") || sFromTable == _T("~valuelabels") ) {
				val=_ttoi(pRS->SQLFldValue(_MBCS("value")));
				colLabels[val] = pRS->SQLFldValue(_MBCS("label"));
			}
			else {
				LPCSTR sLabelCol = ConstChar(sLabelsFld[sFromTable]);
				val=_ttoi(pRS->SQLFldValue(ConstChar(sFromTable)));
				colLabels[val] = pRS->SQLFldValue((sLabelCol));
			}

			
			pRS->MoveNext();
		}
	}

	return TRUE;
	
}